import React, { useState } from 'react';
import VolumeConverter from "./components/VolumeConverter";
import ForceConverter from "./components/ForceConverter";
import SpecificHeatConverter from "./components/SpecificHeatConverter";
import SurfaceTensionConverter from "./components/SurfaceTensionConverter";
import TorqueConverter from "./components/TorqueConverter";
import AreaConverter from "./components/AreaConverter";
import MassConverter from "./components/MassConverter";
import CurrentConverter from "./components/CurrentConverter";
import ViscosityConverter from "./components/ViscosityConverter";
import MagneticFluxDensityConverter from "./components/MagneticFluxDensityConverter";
import MomentOfInertiaConverter from "./components/MomentOfInertiaConverter";
import TemperatureConverter from "./components/TemperatureConverter";
import YoungsModuleConverter from "./components/YoungsModuleConverter";
import TimeConverter from "./components/TimeConverter";
import SpeedConverter from "./components/SpeedConverter";
import PressureConverter from "./components/PressureConverter";
import PowerConverter from "./components/PowerConverter";
import AngularVelocityConverter from "./components/AngularVelocityConverter";
import ResistanceConverter from "./components/ResistanceConverter";
import ResistivityConverter from "./components/ResistivityConverter";
import LengthConverter from "./components/LengthConverter";
import AccelerationConverter from "./components/AccelerationConverter";
import CapacitanceConverter from "./components/CapacitanceConverter";
import ThermalConductivityConverter from "./components/ThermalConductivityConverter";
import AngularAccelerationConverter from "./components/AngularAccelerationConverter";
import FrequencyConverter from "./components/FrequencyConverter";
import IlluminanceConverter from "./components/IlluminanceConverter";
import EnergyConverter from "./components/EnergyConverter";
import ChargeConverter from "./components/ChargeConverter";

const categories = [
  "Acceleration", "Angle", "Angular Acceleration", "Angular Velocity",
  "Area", "Capacitance", "Charge", "Current", "Density", "Electric Field",
  "Energy", "Force", "Frequency", "Illuminance", "Length",
  "Magnetic Flux Density", "Mass", "Moment of Inertia", "Power", "Pressure", "Resistance", "Resistivity",
  "Specific Heat", "Speed", "Surface Tension", "Thermal Conductivity",
  "Temperature", "Time", "Torque", "Viscosity", "Volume", "Voltage",
  "Young's Modulus"
];

export default function App() {
  const [activeCategory, setActiveCategory] = useState(null);

  const renderConverter = () => {
    switch (activeCategory) {
      case "Volume":
        return <VolumeConverter selectedCategory="Volume" />;
      case "Force":
        return <ForceConverter selectedCategory="Force" />;
      case "Specific Heat":
        return <SpecificHeatConverter selectedCategory="Specific Heat" />;
      case "Surface Tension":
        return <SurfaceTensionConverter selectedCategory="Surface Tension" />;
      case "Torque":
        return <TorqueConverter selectedCategory="Torque" />;
      case "Area":
        return <AreaConverter selectedCategory="Area" />;
      case "Mass":
        return <MassConverter selectedCategory="Mass" />;
      case "Current":
        return <CurrentConverter selectedCategory="Current" />;
      case "Viscosity":
        return <ViscosityConverter selectedCategory="Viscosity" />;
      case "Magnetic Flux Density":
        return <MagneticFluxDensityConverter selectedCategory="Magnetic Flux Density" />;
      case "Moment of Inertia":
        return <MomentOfInertiaConverter selectedCategory="Moment of Inertia" />;
      case "Temperature":
        return <TemperatureConverter selectedCategory="Temperature" />;
      case "Young's Modulus":
        return <YoungsModuleConverter selectedCategory="Young's Modulus" />;
      case "Time":
        return <TimeConverter selectedCategory="Time" />;
      case "Speed":
        return <SpeedConverter selectedCategory="Speed" />;
      case "Pressure":
        return <PressureConverter selectedCategory="Pressure" />;
      case "Power":
        return <PowerConverter selectedCategory="Power" />;
      case "Angular Velocity":
        return <AngularVelocityConverter selectedCategory="Angular Velocity" />;
      case "Resistance":
        return <ResistanceConverter selectedCategory="Resistance" />;
      case "Resistivity":
        return <ResistivityConverter selectedCategory="Resistivity" />;
      case "Length":
        return <LengthConverter selectedCategory="Length" />;
      case "Acceleration":
        return <AccelerationConverter selectedCategory="Acceleration" />;
      case "Capacitance":
        return <CapacitanceConverter selectedCategory="Capacitance" />;
      case "Thermal Conductivity":
        return <ThermalConductivityConverter selectedCategory="Thermal Conductivity" />;
      case "Angular Acceleration":
        return <AngularAccelerationConverter selectedCategory="Angular Acceleration" />;
      case "Frequency":
        return <FrequencyConverter selectedCategory="Frequency" />;
      case "Illuminance":
        return <IlluminanceConverter selectedCategory="Illuminance" />;
      case "Energy":
        return <EnergyConverter selectedCategory="Energy" />;
      case "Charge":
        return <ChargeConverter selectedCategory="Charge" />;
      default:
        return (
          <div className="text-center py-12 text-gray-600 text-lg">
            {activeCategory} converter is coming soon...
          </div>
        );
    }
  };

  return (
    <div className="min-h-screen flex flex-col bg-gray-100">
      <header className="bg-white shadow py-4 px-6">
        <div className="text-2xl font-bold text-blue-600">🔄 UnitCompare</div>
      </header>

      <main className="flex-grow p-6">
        <h2 className="text-xl font-semibold text-center mb-6">
          Select a Conversion Category
        </h2>
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-5 gap-4 mb-8">
          {categories.map((cat) => (
            <button
              key={cat}
              onClick={() => setActiveCategory(cat)}
              className={`bg-white shadow hover:bg-blue-50 text-gray-800 font-medium border border-gray-200 rounded px-4 py-3 text-center ${activeCategory === cat ? "ring-2 ring-blue-500" : ""}`}
            >
              {cat}
            </button>
          ))}
        </div>
        {activeCategory && renderConverter()}
      </main>

      <footer className="bg-white border-t text-center text-sm text-gray-500 py-4 mt-6">
        © 2025 UnitCompare. All rights reserved.
      </footer>
    </div>
  );
}
